func TestToMultiAlignCmdTrim(t *testing.T) {

	var err error

	toMultiAlignStart := -1
	toMultiAlignEnd := -1
	toMultiAlignPad := false
	toMultiAlignTrimStart := 265
	toMultiAlignTrimEnd := 29674

	samReader := bytes.NewReader(samData)
	outWriterOld := new(bytes.Buffer)

	if toMultiAlignTrim || toMultiAlignTrimStart != -1 || toMultiAlignTrimEnd != -1 {
		if toMultiAlignStart != -1 || toMultiAlignEnd != -1 {
			err = errors.New(`--start and --end replace --trim, --trimstart and --trimend.
			
Don't combine them (and note the change of coordinate system if using the new options)

`)
		}
	}
	if err != nil {
		t.Error(err)
	}

	if toMultiAlignTrimStart != -1 {
		toMultiAlignStart = toMultiAlignTrimStart + 1
	}

	if toMultiAlignTrimEnd != -1 {
		toMultiAlignEnd = toMultiAlignTrimEnd
	}

	err = sam.ToMultiAlign(samReader, outWriterOld, toMultiAlignStart, toMultiAlignEnd, toMultiAlignPad, samThreads)
	if err != nil {
		t.Error(err)
	}

	toMultiAlignStart = 266
	toMultiAlignEnd = 29674
	toMultiAlignPad = false
	toMultiAlignTrimStart = -1
	toMultiAlignTrimEnd = -1

	samReader = bytes.NewReader(samData)
	outWriterNew := new(bytes.Buffer)

	if toMultiAlignTrim || toMultiAlignTrimStart != -1 || toMultiAlignTrimEnd != -1 {
		if toMultiAlignStart != -1 || toMultiAlignEnd != -1 {
			err = errors.New(`--start and --end replace --trim, --trimstart and --trimend.
			
Don't combine them (and note the change of coordinate system if using the new options)

`)
		}
	}
	if err != nil {
		t.Error(err)
	}

	if toMultiAlignTrimStart != -1 {
		toMultiAlignStart = toMultiAlignTrimStart + 1
	}

	if toMultiAlignTrimEnd != -1 {
		toMultiAlignEnd = toMultiAlignTrimEnd
	}

	err = sam.ToMultiAlign(samReader, outWriterNew, toMultiAlignStart, toMultiAlignEnd, toMultiAlignPad, samThreads)
	if err != nil {
		t.Error(err)
	}

	if outWriterOld.String() != outWriterNew.String() {
		t.Errorf("problem in TestToMultiAlignCmdTrim()")
	}
}

